<ol data-start="172" data-end="345">
<li data-start="172" data-end="217">
<p data-start="175" data-end="217">Library CDN dimuat <strong data-start="194" data-end="205">sebelum</strong> <code data-start="206" data-end="214">app.js</code>.</p>
</li>
<li data-start="218" data-end="298">
<p data-start="221" data-end="298">Set <code data-start="225" data-end="265">pdfjsLib.GlobalWorkerOptions.workerSrc</code> <strong data-start="266" data-end="277">selepas</strong> pdf.min.js dimuat.</p>
</li>
<li data-start="299" data-end="345">
<p data-start="302" data-end="345">Jangan guna <code data-start="314" data-end="329">type="module"</code> untuk skrip ni.</p>
</li>
</ol>
