<ul data-start="383" data-end="564">
<li data-start="383" data-end="453">
<p data-start="385" data-end="453">Memastikan <strong data-start="396" data-end="404">XLSX</strong> dan <strong data-start="409" data-end="421">pdfjsLib</strong> dimuat dulu (dengan fallback)</p>
</li>
<li data-start="454" data-end="511">
<p data-start="456" data-end="511">Hanya selepas kedua-duanya siap, baru load <strong data-start="499" data-end="509">app.js</strong></p>
</li>
<li data-start="512" data-end="564">
<p data-start="514" data-end="564">Set <code data-start="518" data-end="529">workerSrc</code> untuk PDF.js 2.16.105 dengan betul</p>
</li>
</ul>
